import React from 'react';
import ReactDOM from 'react-dom';
import 'bulma/css/bulma.css'


const style = {

    width: '200px'
}

const Search = () => {
    return(
        <div><input style={style}  className="input is-rounded search-box" type="text" placeholder="Type the Booking Id"  /></div>
    )}

    export default Search;
